import fg from "fast-glob"
import Gallery from "../components/Gallery"

export default function Home({ images }) {
  return (
    <Gallery images={images}/>
  );
}

export async function getStaticProps() {
  const images = await fg([
    `public/gallery/inspo/*.png`,
  ])

  console.log(images)

  return {
    props: {
      images
    },
  };
}
